asO(){return new A.a1w(new A.Wm("La bienveillance permissive du groupe","En tant qu\u2019\xeatres humains, nous sommes des \xeatres gr\xe9gaires. Nous grandissons au contact des autres, gr\xe2ce aux autres et avec les autres. Nous nous d\xe9couvrons au contact des autres. Le milieu familial, les amis et les communaut\xe9s dans lesquels nous grandissons, constituent un facteur d\xe9terminant pour notre d\xe9veloppement. Ce que nous partageons avec nos semblables nous construit en humanit\xe9 : \xeatre un humain. Les groupes dans lesquels nous grandissons, nous \xe9voluons sont un \xe9l\xe9ment fondamental de la structuration de notre l'identit\xe9 : la reconnaissance des autres et \xe0 la base de la reconnaissance de soi. L\u2019enfant qui re\xe7oit des signes de reconnaissance, d\u2019encouragement va d\xe9velopper une estime de lui-m\xeame. La qualit\xe9 de la relation et du partage au sein d'un groupe a une influence tant sur notre sant\xe9 mentale que physique. Une \xe9tude r\xe9alis\xe9e sur 75 ans (1938) concernant 750 personnes (60 encore vivants apr\xe8s 90 ans en 2016) entretien sur leur parcours de vie, leur parcours professionnel, position sociale, leur vie sentimentale ou amicale, leurs donn\xe9es m\xe9dicales. La conclusion majeure de cette \xe9tude : entretenir de bonnes relations avec amis, famille, communaut\xe9s nous rend plus heureux et en meilleure sant\xe9 et ce ind\xe9pendamment de notre milieu d\u2019origine (Pauvres Boston, riches Harvard) Pourtant lorsqu\u2019on leur avait demand\xe9 ce qui les rendrait heureux : l\u2019argent, le travail, la c\xe9l\xe9brit\xe9 c\u2019est \xe0 dire autant d\u2019injonction soci\xe9tales. Ce n\u2019est pas la quantit\xe9 de relations mais la qualit\xe9 des relations qui compte : vivre au milieu du conflit  est mauvais pour notre sant\xe9. C\u2019est quoi le lien avec la biodanza ? Le cadre pos\xe9 en biodanza permet l\u2019\xe9mergence d\u2019un groupe bienveillant et permissif. Un groupe, ou personne ne joue un r\xf4le social, n\u2019est reconnu ou valoris\xe9 pour un niveau de c\xe9l\xe9brit\xe9, un titre ou une performance chor\xe9graphique particuli\xe8re. Le groupe en biodanza est un creuset dans lequel chacun peut suivre et r\xe9v\xe9ler sa nature profonde gr\xe2ce aux rencontres authentiques avec les autres compagnons.Authentiques car v\xe9cues dans l\u2019instant de chaque danse sans injonctions culturelles. C\u2019est la pr\xe9sence des autres qui me permet de me rencontrer : il n\u2019y pas de biodanza seul ni \xe0 distance. Nous encourageons la r\xe9gularit\xe9 hebdomadaire de la biodanza \xe9galement pour d\xe9velopper la confiance entre les membres du groupe. Cette confiance qui permettra \xe0 chacun d\u2019encore plus oser \xeatre soi sans avoir peur d\u2019\xeatre jug\xe9. Dans cette s\xe9ance, je vous propose de contribuer \xe0 fa\xe7onner ensemble ce creuset.","",new A.Xp("Th","Co"),A.a([],t.PW),A.dN(0)),new A.AA("Roseaux dans le vent","https://cdn.pixabay.com/vimeo/803732906/Roseaux%20-%20152740.mp4?width=640&hash=4cdf2375f86628b94c81dfbe1e40e597e653ab02"))},
